柔らかなスエードレザーアッパー、スリッポンタイプのスポーティーで、カジュアルなクールウェザー用 コンフォートショートブーツ。最新のテクノロジーがスタイリッシュさと快適さを融合した、軽量タイプのボアブーツです。インナーは足先までふわふわなファー仕様なので、足元を暖かく包み、保温性も抜群です。快適さと反応性を高めた5GENミッドソールと、衝撃を吸収しサポート力が高いGoga Mat(ゴガマット) インソールを搭載。Goimpulse センサーを配したソールが、濡れた路面等で高いグリップ力を提供します。※展開サイズ：レディース<br><br>・素材：天然皮革/合成繊維<br>・アウトソール：合成底<br>・ヒールの高さ：約3.0cm<br>・重量(片足)：約210g(23.5cm)<br>・筒丈：約12.0cm<br>・履き口周り：約25.0cm<br>・サイズ感：(個人差がございますので、あくまでも目安です)やや小さめ。幅広の方は0.5cm大きめをご検討下さい。<br>サイズ換算表はこちら→<style type="text/css">
