最新のテクノロジーがスタイリッシュさと快適さと融合した、Skechers On the GO 400 シリーズの Blaze ブーツ。<BR> 
柔らかなスエードのアッパー、スリッポンタイプのスポーティーでカジュアルなクールウエザー用コンフォートショートブーツ。<BR>
5GEN ミッドソールと Goga Mat インソール搭載。<BR> <BR>
<BR>
<BR><BR>

●詳細<BR>

   ■快適さとレスポンスを高める5GEN ミッドソール<BR><BR>
   ■エネルギーリターンを可能にする第5世代のテクノロジーがさらに軽量な走りを提供<BR>

<BR>
   ■衝撃を吸収しサポート力が高い Goga Mat インソール<BR><BR>

   ■ Goimpulse センサーを配したソールが路面をとらえる高反応のトラクション（グリップ）を提供<BR>
   ■バイオメトリック設計の、サポート力と安定感を提要するミッドソール<BR><BR>

